import React from "react";
import { View, Text } from "react-native";
import StylePassCentre from "./StylePasswordCenter";

const PasswordCenter =()=>{
    return<View>
        <View style={StylePassCentre.switchOn} ><Text>Off lock code</Text></View>
        <View style={StylePassCentre.switchOn} ><Text>Edit lock code</Text></View>
        <View style={StylePassCentre.switchOn} ><Text>Unlock to Face or Touch id</Text></View>
    </View>
}

export default PasswordCenter;
